import { Component } from '@angular/core';
import { AbstractControl, FormControl, FormGroup, ValidatorFn, Validators } from '@angular/forms';
import { LoginServiceService } from '../Services/login-service.service';

@Component({
  selector: 'app-registration',
  templateUrl: './registration.component.html',
  styleUrls: ['./registration.component.css']
})
export class RegistrationComponent {
RegisterForm:FormGroup;
constructor(private loginService:LoginServiceService){
  this.RegisterForm = new FormGroup({
    name1:new FormControl('',[Validators.required]),
    mobNo:new FormControl('',[Validators.required]),
    isOwner:new FormControl('',[]),
    email:new FormControl('',[Validators.required,emailValidator()]),
    password: new FormControl('',[Validators.required,passwordValidator()]),
    password1: new FormControl('',[Validators.required]),
    city:new FormControl('',[Validators.required])
  })
}
regFun(){
  const data = this.RegisterForm.value;
  // this.loginService.register(data).subscribe((x:any)=>{
    console.log(data);
    alert("Register Successfully...!!!");
  // window.location.href="/login";
  // })

}
}
export function emailValidator(): ValidatorFn {
  return (control: AbstractControl): { [key: string]: any } | null => {
    const emailPattern = /^[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Za-z]{2,}$/;
    const valid = emailPattern.test(control.value);
    return valid ? null : { invalidEmail: true };
  };
}
export function passwordValidator(): ValidatorFn {
  return (control: AbstractControl): { [key: string]: any } | null => {
    const passwordPattern = /^[A-Za-z+_.-]+@[0-9]{}$/;
    const valid1 = passwordPattern.test(control.value);
    return valid1 ? null : { invalidPassword: true}
  }
}
